import '../css/footer.css'
import { ChatBTN, HelpBTN } from './Buttons';

const Footer = () => {
    return (
        <div>
        <ChatBTN/><HelpBTN />
        <footer>
            <hr />            
            <div class="footer"> copyright ---- </div>             
        </footer></div>
    )
}


export default Footer;
